package com.neu.myapp.pojo;

import java.awt.List;

public class SamplePaper {

	private int sampleId;
	private List sampleQuestions;
	private List sampleAnswers;
	
	
	public SamplePaper() {
		// TODO Auto-generated constructor stub
	}


	public int getSampleId() {
		return sampleId;
	}


	public void setSampleId(int sampleId) {
		this.sampleId = sampleId;
	}


	public List getSampleQuestions() {
		return sampleQuestions;
	}


	public void setSampleQuestions(List sampleQuestions) {
		this.sampleQuestions = sampleQuestions;
	}


	public List getSampleAnswers() {
		return sampleAnswers;
	}


	public void setSampleAnswers(List sampleAnswers) {
		this.sampleAnswers = sampleAnswers;
	}
	
	
}
